import React from 'react';
import Navi from './Navi.js';
import Category from './Category.js';
import ProductList from './ProductList.js';
import {Container, Row} from 'reactstrap';


function App(){
    return(
        <div>
            <Container>
                <Row>
                     <Navi/>
                </Row>
                <Row>
                    <Category/>
                    <ProductList/>

                </Row>
            </Container>
            
        </div>

    );
}

export default App;
